export const SET_CONTACTOS = 'SET_CONTACTOS';

export function setContactos(contactos){
    return {
       
        type: SET_CONTACTOS,
        contactos
    }
}
export function fetchContactos()
{
    alert('2');
    return dispatch =>{
        fetch('https://localhost:44386/api/Contactos')
        .then(res => res.json())
        .then(function(data) {
            alert('proporciono datos');
        }).catch(function(err) {
               alert('hubo un error');
            });
    }
}
